geregisseerd door Shari Springer Berman en Robert Pulcini
met Kristen Wiig, Annette Bening en Matt Dillon

Een redelijk succesvolle toneelschrijfster (Kristen Wiig) uit New York faket een zelfmoordpoging om zo haar voormalige vriendje terug te winnen. In plaats daarvan wordt ze echter onder de voogdij geplaatst van haar moeder (Annette Bening), een onhebbelijke gokverslaafde.



